
DROP TABLE IF EXISTS REALISE;
DROP TABLE IF EXISTS JOUE;
DROP TABLE IF EXISTS REMPORTE;
DROP TABLE IF EXISTS GENRE;
DROP TABLE IF EXISTS PAYS;
DROP TABLE IF EXISTS FILM;
DROP TABLE IF EXISTS PERSONNE;


CREATE TABLE PERSONNE (pid INTEGER PRIMARY KEY,
                       prenom VARCHAR(20),
                       nom VARCHAR(30));
CREATE TABLE FILM (fid INTEGER PRIMARY KEY,
                   titre VARCHAR(255),
                   annee INTEGER,
                   duree INTEGER,
                   titre_orig VARCHAR(255));

CREATE TABLE GENRE(fid INTEGER, genre VARCHAR(25), FOREIGN KEY (fid) REFERENCES FILM(fid));
CREATE TABLE PAYS (fid INTEGER , pays VARCHAR(25), FOREIGN KEY (fid) REFERENCES FILM(fid));
CREATE TABLE REMPORTE (fid INTEGER, annee INTEGER, pres_id pid, FOREIGN KEY (fid) REFERENCES FILM(fid));
CREATE TABLE REALISE (pid INTEGER REFERENCES PERSONNE (pid),
                   fid INTEGER REFERENCES FILM(fid), FOREIGN KEY (fid) REFERENCES FILM(fid), FOREIGN KEY (pid) REFERENCES PERSONNE(pid));
CREATE TABLE JOUE (pid INTEGER REFERENCES PERSONNE (pid),
                   fid INTEGER REFERENCES FILM(fid),
                   role VARCHAR(255),
                   FOREIGN KEY (fid) REFERENCES FILM(fid), FOREIGN KEY (pid) REFERENCES PERSONNE(pid));

